import { createRef, useEffect, useState } from 'react';
import QRCode from 'react-qr-code';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useParams
  } from "react-router-dom";
import * as htmlToImage from 'html-to-image';
import { toPng, toJpeg, toBlob, toPixelData, toSvg } from 'html-to-image';
import Pdf from "react-to-pdf";
import { saveAs } from 'file-saver';
import { useNavigate} from "react-router-dom";
const Invite =()=>{
    let {email}= useParams();
    const [dia,setDia]=useState('')
    const [horario, setHorario]=useState('')
    const navigate= useNavigate();
    const ref= createRef();
    
    //Image download
    function downloadInvite(e) {
        setTimeout(()=>{
            navigate(`/asistencia/${email}`)
        },2000)
    }  
    const fetchData=async()=>{
        const requestOptions = {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({values:{email:`${email}`}})
          };
        fetch("https://beemexico.com/lenovo-event/getDate", requestOptions)
          .then(async (response)=>{
            try {
                  const data = await response
                      .json();
                    setDia(data.fecha)
                    setHorario(data.horario)
                  return data;
              } catch (error) {
                  console.log(error.message);
              }
          })
    }
    useEffect(()=>{
        document.querySelector("main").addEventListener("click", downloadInvite);
    },[])
    useEffect(()=>{
        fetchData()
    },[dia,horario])
    
    
    return(
        <>
        <div className="container">
        <Pdf targetRef={ref} filename="Lenovo-Tech-One-MX-Confirmacion.pdf"scale={0.85}>
        {({ toPdf }) => 
        <div onClick={toPdf}>
        <main id="mains" ref={ref}>
        <img className='invite-img'
            src="data:image/png;base64,"
            />
            <div id="qr" className="cabra">
                <QRCode value={email} size={150} className='qr-desktop'/>
                <QRCode value={email} size={100} className='qr-mobile'/>
            </div>
            <div id="output" className="tech-day">
                <p className="text-tech-day">{dia} de 2022</p>
            </div>
            <div id="out" className="horario">
                <p className="text-tech-day">{horario} h.</p>
            </div>
        </main>
        </div>
        }
      </Pdf>
        </div>
        </>
    )
}

export default Invite;